import React from "react"
import SuperHero from "./SuperHero"

const SuperHeroList = () => {
    const superHeros = [
        {
            name: "Flash",
            img: "data:image/jpeg;base64,",
            catchPhrase: "Back in a flash"
        },
        {
            name: "Batman",
            img: "data:image/jpeg;base64,",
            catchPhrase: "I am Batman"
        },
        {
            name: "Green Lantern",
            img: "data:image/jpeg;base64,",
            catchPhrase: "In brightest day, in blackest night, No evil shall escape my sight. Let those who worship evil’s might. Beware my power—Green Lantern’s Light"
        },
        {
            name: "Spider-Man",
            img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTvvPpVCoUbpkzl43zHkinXRw8jtNanHMsmAiotAC-Tdnmc994K",
            catchPhrase: "I’m your friendly neighborhood Spider-Man"
        }
    ]

    const info = superHeros.map((hero, i) => {
        return <SuperHero
            key={hero.name + i}
            name={hero.name}
            img={hero.img}
            catchPhrase={hero.catchPhrase}
        />
    })

    return (
        <div>
            {info}
        </div>
    )

}

export default SuperHeroList